css:
@-moz-document domain("goodblox.xyz") {
body {
    font: normal 8pt/normal 'Verdana', sans-serif;
    margin: 0;
    text-transform: none;
    text-decoration: none;
    height: 100%;
    background-image: linear-gradient(180deg, #1b3048, #9aa4b9);
    background-repeat: no-repeat;
    background-size: 100% 1024px;
    background-color: #9aa4b9;
    color: white;
}

#Logo img {
    content: url("https://goodblox.xyz/resources/frozen_halloween.png");
}
#Banner {
    background-image: url(https://goodblox.xyz/resources/banners/frozen_halloween.png);
}

#ProfilePane {
    background: steelblue;
}

a:link, a:visited, a:active {
    color: deepskyblue;
}
}

@-moz-document domain("blog.goodblox.xyz") {
body {
    background: #DFDBC3 top center repeat-y;
    font-size: 1em;
    font-family: Verdana, Arial, 'Times New Roman';
    color: #000;
}
}
